liczba_kosci = 5
mozliwe_opcje = []
wyrzucone_kosci = []
punkty = [0,0]
punkty_tury = 0
gracz = 0
def rzut_koscmi(ile_kosci):
    wyrzucone_kosci.clear()
    for i in range(ile_kosci):
        wyrzucone_kosci.append(random.randint(1,6))
    pokaz_kosci()
    
